import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and fill the minimum price input
    const minPriceInput = page.locator('#minPrice');
    await minPriceInput.waitFor({ state: 'visible', timeout: 5000 });
    await minPriceInput.fill('50');

    // Locate and fill the maximum price input
    const maxPriceInput = page.locator('#maxPrice');
    await maxPriceInput.waitFor({ state: 'visible', timeout: 5000 });
    await maxPriceInput.fill('150');

    // Take a screenshot after filling the price range
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_range_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_range_entered.png'));

    // Locate and click the apply filter button
    const applyButton = page.locator('button.apply-filter');
    await applyButton.waitFor({ state: 'visible', timeout: 5000 });
    await applyButton.click();

    // Take a final screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract data to verify the action
    const extractedMinPrice = await minPriceInput.inputValue();
    const extractedMaxPrice = await maxPriceInput.inputValue();

    return {
      success: true,
      action: "Applied price range filter from 50 to 150.",
      extractedData: {
        minPrice: extractedMinPrice,
        maxPrice: extractedMaxPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
